function getOverlayIcon(text) {
    // Create badge
    var canvas = document.createElement("canvas");
    canvas.height = 140;
    canvas.width = 140;
    var ctx = canvas.getContext("2d");
    ctx.fillStyle = "red";
    ctx.beginPath();
    ctx.ellipse(70, 70, 70, 70, 0, 0, 2 * Math.PI);
    ctx.fill();
    ctx.textAlign = "center";
    ctx.fillStyle = "white";

    if (text.length > 2) {
        ctx.font = "75px sans-serif";
        ctx.fillText("" + text, 70, 98);
    } else if (text.length > 1) {
        ctx.font = "100px sans-serif";
        ctx.fillText("" + text, 70, 105);
    } else {
        ctx.font = "125px sans-serif";
        ctx.fillText("" + text, 70, 112);
    }

    var badgeDataURL = canvas.toDataURL();
    return nativeImage.createFromDataUrl(badgeDataURL);
}

function getNewIconWithOverlayIcon(text) {
    var canvas = document.createElement("canvas");
    canvas.height = 170;
    canvas.width = 170;

    var ctx = canvas.getContext("2d");
    ctx.drawImage(imageObj, 0, 0, canvas.width, canvas.height);

    if (text) {

        var radiusX = 50;
        var radiusY = 50;

        if ((text + '').length > 2) radiusX += ((text + '').length - 2) * 25;

        ctx.fillStyle = "#ff3b30";
        ctx.beginPath();
        ctx.ellipse(canvas.width - radiusX, canvas.height - radiusY, radiusX, radiusY, 0, 0, 2 * Math.PI);
        ctx.fill();
        ctx.textAlign = "center";
        ctx.fillStyle = "white";

        /*if (text.length > 2) {
         ctx.font = "35px sans-serif";
         ctx.fillText("" + text, canvas.width - radiusX, 98);
         } else if (text.length > 1) {
         ctx.font = "40px sans-serif";
         ctx.fillText("" + text, canvas.width - radiusX, 105);
         } else {
         ctx.font = "75px sans-serif";
         ctx.fillText("" + text, canvas.width - radiusX, 70);
         }*/

        ctx.font = "bold 85px sans-serif";
        ctx.fillText("" + text, canvas.width - radiusX, canvas.height - radiusY / 2);
    }

    var img = nativeImage.createFromDataURL(canvas.toDataURL());
    fs.writeFileSync( __dirname + '/image-icon.png', img.toPng());

    return __dirname + '/image-icon.png';
    //return canvas.toDataURL();
}

ipcRenderer.on('set-window-icon', (event, arg) => {
    setWindowIconWithBadge(true);
});

ipcRenderer.on('syn-get-message-count', (event, arg) => {
    ipcRenderer.send('syn-get-message-count-callback', getUnreadCount());
});

function setWindowIconWithBadge(isFlashWindow = false) {
    var text = getUnreadCount();
    if (+text > 99) { text = '99+'; }

    var win = remote.getCurrentWindow();

    if (isFlashWindow) {
        win.flashFrame(Boolean(text));
    }

    switch (process.platform) {
        case 'darwin':
            app.dock.setBadge("" + text);
            break;
        case 'win32':
            if (text === "") {
                win.setOverlayIcon(null, "");
                return;
            }
            win.setOverlayIcon(getOverlayIcon(text), text);
            break;
        default:
            if (!text) {
                win.setIcon(__dirname + '/icon.png');
                return;
            }

            win.setIcon(getNewIconWithOverlayIcon(text));
            break;
    }
}

ipcRenderer.on('syn-get-icon-with-badge', (event, arg) => {
    setWindowIconWithBadge();
});

function getUnreadCount() {
    var els = document.querySelectorAll('.UnreadIndicator span');

    var count = 0;
    for (let i = 0; i < els.length; i++) {
        count += parseInt(els[i].innerHTML) || 0;
    }

    count += document.querySelectorAll('.icon-missedCall,.VoiceInvites-container').length;
    return count;
}

var clickTimeout = null;
document.addEventListener('DOMContentLoaded', function () {

    document.addEventListener("click", function () {
        clearTimeout(clickTimeout);
        clickTimeout = setTimeout(setWindowIconWithBadge, 700);
    });

    setTimeout(setWindowIconWithBadge, 1000*7);

});

